    return(
        <div>
            <h2>{title}</h2>
            <div className="movieRow--listarea">
                {items.results.lenght > 0 && items.results.map((item,key)=>(
<img src={`htpps://image.tmdb.org/t/p/w300${item.poster_path}`} />
                )) }
            </div>
        </div>
    )
}
